#!/usr/bin/env python3
"""
PX Center Logo - Embedded as Base64

This file contains the PX Center logo embedded directly as base64 to avoid
file transfer issues between Claude's container and the user's Mac.

Usage:
    from logo import get_logo_stream
    slide.shapes.add_picture(get_logo_stream(), Inches(0.5), Inches(0.3), width=Inches(1.5))
    
    # Or write to file:
    from logo import write_logo_file
    logo_path = write_logo_file()
"""

import base64
import io
import os

LOGO_BASE64 = """
"""


def get_logo_bytes():
    """Returns logo as raw bytes."""
    return base64.b64decode(LOGO_BASE64)


def get_logo_stream():
    """Returns logo as BytesIO stream for use with python-pptx add_picture()."""
    return io.BytesIO(get_logo_bytes())


def write_logo_file(path='/tmp/px-branding/logo.png'):
    """
    Writes logo to disk and returns the path.
    Creates parent directories if needed.
    """
    os.makedirs(os.path.dirname(path), exist_ok=True)
    with open(path, 'wb') as f:
        f.write(get_logo_bytes())
    return path


def verify_logo():
    """Verify the embedded logo is valid PNG data."""
    data = get_logo_bytes()
    # PNG magic bytes
    if data[:8] == b'\x89PNG\r\n\x1a\n':
        return True, "Valid PNG"
    return False, f"Invalid: starts with {data[:8].hex()}"


if __name__ == '__main__':
    # Test the logo
    valid, msg = verify_logo()
    print(f"Logo verification: {msg}")
    
    if valid:
        path = write_logo_file()
        print(f"Logo written to: {path}")
        
        # Verify with file command if available
        import subprocess
        try:
            result = subprocess.run(['file', path], capture_output=True, text=True)
            print(f"File type: {result.stdout.strip()}")
        except FileNotFoundError:
            print("(file command not available for verification)")